import React from 'react';
import { Grid } from '@material-ui/core';



const Item = styled(Paper)(({ theme }) => ({
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  }));
const Home = () =>{
    return(
        <>
        <Grid item xs={4}>
    <Item>xs=4</Item>
  </Grid>

        </>
    )
 
}

export default Home;
